const LegendControl = ({ counts, totalCounts, onZoneClick }) => {
  const map = useMap();

  useEffect(() => {
    const legend = L.control({ position: "topright" });

    legend.onAdd = function () {
      const div = L.DomUtil.create("div", "legend");

      div.innerHTML = `
        <div style="background: white; padding: 10px; border-radius: 8px; box-shadow: 0 4px 8px rgba(0,0,0,0.3); width: 270px; max-height: 450px; overflow-y: auto; overflow-x: hidden;">
          <h6 style="margin-bottom: 10px; text-align: center;"><b>Zone-wise Cancellation Count</b></h6>

          <!-- Total Counts Section -->
          <div style="display: flex; justify-content: space-between; align-items: center; margin-bottom: 10px; padding: 5px; background: #f9f9f9; border-radius: 4px;">
            <div style="display: flex; align-items: center;">
              <div style="width: 15px; height: 15px; background-color: purple; border-radius: 50%; margin-right: 5px;"></div>
              <span style="font-size: 12px;">Enquiry Cancellation: <b>${totalCounts.enquiry}</b></span>
            </div>
            <div style="display: flex; align-items: center;">
              <div style="width: 15px; height: 15px; background-color: yellow; border-radius: 50%; margin-right: 5px;"></div>
              <span style="font-size: 12px;">Service Cancellation: <b>${totalCounts.service}</b></span>
            </div>
          </div>

          <!-- Zone-wise Table -->
          <table style="width: 100%; border-collapse: collapse; font-size: 12px;">
            <thead>
              <tr>
                <th style="padding: 4px; text-align: left; border-bottom: 1px solid #ddd;">Zone</th>
                <th style="padding: 4px; text-align: right; border-bottom: 1px solid #ddd;">Enquiry Cancellation</th>
                <th style="padding: 4px; text-align: right; border-bottom: 1px solid #ddd;">Service Cancellation</th>
              </tr>
            </thead>
            <tbody>
              ${Object.keys(counts)
                .map(
                  (zone) => `
                <tr class="zone-row" data-zone="${zone}" style="cursor: pointer;">
                  <td style="padding: 4px; border-bottom: 1px solid #ddd;">${zone}</td>
                  <td style="padding: 4px; text-align: right; border-bottom: 1px solid #ddd;">${counts[zone]["Enquiry Cancellation"] || 0}</td>
                  <td style="padding: 4px; text-align: right; border-bottom: 1px solid #ddd;">${counts[zone]["Service Cancellation"] || 0}</td>
                </tr>
              `
                )
                .join("")}
            </tbody>
          </table>
        </div>
      `;

      return div;
    };

    legend.addTo(map);

    // Add event listeners for zone click
    const handleZoneClick = (e) => {
      const clickedZone = e.target.closest(".zone-row")?.dataset.zone;
      if (clickedZone && onZoneClick) {
        onZoneClick(clickedZone);
      }
    };

    const legendContainer = document.querySelector(".legend");
    legendContainer?.addEventListener("click", handleZoneClick);

    return () => {
      legendContainer?.removeEventListener("click", handleZoneClick);
      map.removeControl(legend);
    };
  }, [map, counts, totalCounts, onZoneClick]);

  return null;
};





